import { Home } from './screens/Home';
import { Vehicle } from './screens/Vehicle';
import { Service } from './screens/Service';
import { ReactComponent as Logo } from './visuals/brand/LOGO_FULL_LIGHT.svg';

import 'bootstrap/dist/css/bootstrap.min.css';
import './styles/main.css';
import {Routes, Route, NavLink} from 'react-router-dom';

function App() {
  return (
    <div className='bg-image'>
    <div>
       <header>
            <nav className='mt-5 container d-flex justify-content-around text-center'>
                <NavLink to='/' 
                className="nav-link">Nous <br/> Connaitre</NavLink>
                <NavLink to='/services' 
                className="nav-link">Nos <br/>Services</NavLink>
                <Logo className='navbar-logo'/>
                <NavLink to='/vehicles' 
                className="nav-link">Nos <br/>Vehicules</NavLink>
                <NavLink to='/vehicles' 
                className="nav-link">Nos <br/>Vehicules</NavLink>
              </nav>
              <Routes>
              <Route path="/" element={<Home/>}/>
              <Route path="/services" element={<Service/>}/>
              <Route path="/vehicles" element={<Vehicle/>}/>
            </Routes>
        </header>
      <div className="App">

      </div>
    </div>
  </div>
  );
}

export default App;
